“MIND YOUR OWN DAMN UTERUS❗️” 📸 Art feature by Platform Art Curator @amandabjorn

“I took this image last month as the start of a new series I was revisiting. I’m realizing this project has always been about my own relationship to my body and the choices that I’ve been given and that have been taken away to protect it. Today, one of the harshest abortion laws goes into effect in Texas and my heart breaks for so many people who are losing that basic right of freedom.”

@feminist is now raising funds for @prochoiceamerica  to help secure the right to choose. Please consider donating via this post 🐚 🐚 🐚
